import React from 'react'

const Cards = (props) => {
  return (
    <div className='cards'>
        <div className='image_box'>
          {props.item.map(deneme=>(
            <img src={deneme.img} alt=""/>
          ))}
        
        </div>
        <div className='details'>
          <p>{props.title}</p>
        </div>
    </div>
   )
}

export default Cards
